{'id': 87047, 'body': "We are sorry for the inconveniences. Login out is free and will never be a paid option. To log out make you need to have an email address to your account so you don't love any data. Once it's done you will be able to log out. As for the grid, results may be different from a device to another for security purpose still, all guys nearby should appear one way or another.

Thank you for your review, it help us make the app better.
If you have any concern don't hesitate to contact us at : feedback@gethornet.com", 'modified': '2017-04-04T20:16:39Z'}
